import React, { useEffect, useState } from 'react';
import Card from '@mui/material/Card';
import CardMedia from '@mui/material/CardMedia';
import CardActions from '@mui/material/CardActions';
import Button from '@mui/material/Button';
import Grid from '@mui/material/Grid';
import Dialog from '@mui/material/Dialog';
import DialogContent from '@mui/material/DialogContent';

function Content() {
  const [rawData, setRawData] = useState('');
  const [mediaItems, setMediaItems] = useState([]);
  const [openDialog, setOpenDialog] = useState(false);
  const [selectedMedia, setSelectedMedia] = useState(null);

  useEffect(() => {
    const params = new URLSearchParams(window.location.search);
    const dataParam = params.get('data');

    if (dataParam) {
      setRawData(dataParam);
    }
  }, []);

  useEffect(() => {
    try {
      const data = JSON.parse(rawData);
      if (Array.isArray(data)) {
        setMediaItems(data);
        console.log('Datos analizados:', data);
      }
    } catch (error) {
      console.error('Error al analizar datos en bruto:', error);
    }
  }, [rawData]);

  const handleMediaClick = (media) => {
    console.log('Media clickeado:', media);
    setSelectedMedia(media);
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setSelectedMedia(null);
    setOpenDialog(false);
  };

  return (
    <div>
      {mediaItems.length > 0 ? (
        <div>
          <Grid container spacing={2}>
            {mediaItems.map((media, index) => (
              <Grid item xs={12} sm={6} md={4} key={index}>
                <Card
                  sx={{
                    height: '100%',
                    display: 'flex',
                    flexDirection: 'column',
                  }}
                >
                  <CardMedia
                    component="div"
                    sx={{
                      pt: '75%',
                      backgroundColor: 'transparent',
                      cursor: 'pointer',
                    }}
                    onClick={() => handleMediaClick(media)}
                  >
                    {media.tipo.startsWith('image/') ? (
                      <img src={media.link} alt={`Image ${index}`} style={{ width: '100%', height: '100%', objectFit: 'cover' }} />
                    ) : (
                      <video controls style={{ width: '100%', height: '100%', objectFit: 'cover' }}>
                        <source src={media.link} type={media.tipo} />
                        Tu navegador no admite la reproducci√≥n de videos.
                      </video>
                    )}
                  </CardMedia>
                  <CardActions sx={{ backgroundColor: '#eaeff1' }}>
                    <Button size="small">View</Button>
                  </CardActions>
                </Card>
              </Grid>
            ))}
          </Grid>

          <Dialog open={openDialog} onClose={handleCloseDialog} maxWidth="xl">
            <DialogContent>
              {selectedMedia && selectedMedia.tipo.startsWith('image/') ? (
                <img src={selectedMedia.link} alt="FullScreen" style={{ width: '100%', height: 'auto' }} />
              ) : (
                selectedMedia && selectedMedia.tipo.startsWith('video/') ? (
                  <video controls style={{ width: '100%', height: 'auto' }}>
                    <source src={selectedMedia.link} type={selectedMedia.tipo} />
                    Tu navegador no admite la reproducci√≥n de videos.
                  </video>
                ) : null
              )}
            </DialogContent>
          </Dialog>
        </div>
      ) : (
        <p>No hay medios para mostrar.</p>
      )}
    </div>
  );
}

export default Content;
